import React from "react";
import styled from "styled-components";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";

const Wrapper = styled.section`
  .contact {
    text-align: center;
    display: grid;
    gap: 5%;
    h2 {
      font-size: 45px;
    }
    img {
      width: 100%;
    }
    .partners-inner {
      display: flex;
      justify-content: center;
      align-items: center;
      flex-direction: column;

      .right {
        padding: 10% 5%;
        display: grid;
        gap: 5%;
        .images {
          display: flex;
          justify-content: center;
          align-items: center;
          gap: 3%;
          a {
            width: 21%;
            img {
              border-radius: 7px;
              height: 59.5px;
            }
          }
        }
        .links {
          display: flex;
          align-items: center;
          justify-content: center;
          gap: 5%;
          a {
            border-right: 1px solid #000;
            padding-right: 2%;
            color: #000;
            font-size: 19px;
            font-weight: 500;
          }
          .blog {
            border-right: none;
            padding-right: 0%;
          }
        }
        .form {
          form {
            display: flex;
            align-items: center;
            justify-content: center;
            flex-wrap: wrap;
            gap: 5%;
          }
          .text-field {
            display: flex;
            gap: 5%;
            width: 100%;

            // Responsive styles
            @media (max-width: 768px) {
              flex-direction: column;
              align-items: stretch;
            }
          }
        }
      }
    }
  }
`;

function Contact() {
  return (
    <Wrapper>
      <div className="contact">
        <h2>Stay Engaged</h2>
        <div className="partners-inner">
          <div className="left">
            <img src="./images/engaged.png" alt="image" />
          </div>
          <div className="right">
            <div className="images">
              <a href="https://www.instagram.com">
                <img src="./images/e4.jpg" alt="video" />
              </a>
              <a href="https://www.instagram.com">
                <img src="./images/e1.jpg" alt="image" />
              </a>
              <a href="https://www.instagram.com">
                <img src="./images/e2.jpg" alt="image" />
              </a>
              <a href="https://www.instagram.com">
                <img src="./images/e3.jpg" alt="video" />
              </a>
            </div>
            <div className="links">
              <a href="https://www.instagram.com">Instagram</a>
              <a href="https://www.linkedIn.com">LinkedIn </a>
              <a href="https://www.blog.com" className="blog">
                {" "}
                Blog
              </a>
            </div>
            <div className="form">
              <h5>Sign Up For Our Mailing List</h5>
              <form action="#">
                <TextField
                  id="filled-basic"
                  label="First Name"
                  variant="filled"
                />
                <TextField
                  id="filled-basic"
                  label="Last Name"
                  variant="filled"
                />
                <TextField id="filled-basic" label="Email" variant="filled" />
                <Button variant="contained">Submit</Button>
              </form>
            </div>
          </div>
        </div>
      </div>
    </Wrapper>
  );
}

export default Contact;
